import React from 'react';
const HomePage = () => (
    <React.Fragment>
    <h1>Hello, welcome to Toon-Land !</h1>
    <p>
You can view some of your favorite cartoon characters.
    </p>
    <p>
Surely, you will be taken back in time to your youth.
    </p>
    </React.Fragment>
);

export default HomePage;
